Head capsule: Anterior projection of sutures short, triangular, pointing straight anteriorly (
Fig. 21
). Posteromedian impression moderately deep. Antenna 1.2–1.5 times body length. First flagellum with 56–124 articles apart from specimens in which node is undifferentiated with extreme asymmetry (e.g., 65 / 173 or 174 / 78 articles) between left and right antennae, mean 75 articles (N= 84 , specimens> 14 mm body length); asymmetry between numbers of articles in first flagellum on each side of a specimen usually less than 10 articles, ranging to 26 ; ring-like articles with two or three whorls of densely arranged hairs with a flattened section and gentle curvature (
Fig. 19
) and a few trichoid setae in a single whorl encircling distal end of article (
Fig. 20
); hairs on distal part of second flagellum in either one or two whorls per article, these differing whorl numbers typically on alternating articles. Tömösváry organ small, in typical position between eye and base of antenna (
Fig. 27
); median pore encircled by a few rings of small swellings.

