Fig. 
7

). Labral bristles differentiated into narrow outer band of short, pectinate bristles and wider inner band of longer simple bristles (

Fig. 
6

). Two clusters of sensilla along midline of labral trapezoid: more distal unpaired, transverse group of a few dozen bottle-shaped sensilla (

Fig. 
9

) at termination of median ridge (

Fig. 
7

