Fig. 
10

); proximal aggregations comprise a lateral pair of groups of mostly bottle-shaped sensilla and a few buttonshaped sensilla (

Fig. 
11

), and slightly distal to the lateral aggregations a median side-by-side pair of buttonshaped sensilla. Chevron-shaped spine row of triangular and distally-curved denticles at border between labral and clypeal part of epipharynx (

Fig. 
12

); immediately proximal to spine row is dense median field of pectinate spines composed of broadly rhomboid distal portion with pectinate spines and narrow, subparallel-sided proximal portion (

Fig. 
13

